import React from 'react'
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';


function ProofessorLogin() {
    return (
        <div>
            <Button variant="contained">
                 <Link to="/home" class="a">Back</Link>
            </Button>
            <p>Professor Login Page</p>
        </div>
    );
}

export default ProofessorLogin;
